import style from "./App.module.css";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import "bootstrap/dist/css/bootstrap.css";
import Form from 'react-bootstrap/Form'
import twitter from './twitter.png'
import React from 'react';
import { Text, View } from 'react-native';

function App() {
  return (
    <div className="App">
      <Text></Text>
      <Card style={{ width: "60%", marginLeft: "20%", marginTop: '2%',borderRadius:'10%' }}>
        <Card.Body>
        <img src={twitter} style={{width:'10%',height:'auto',marginLeft:'43%'}}></img>

          <Form>
            <Form.Group className="mb-3" controlId="formBasicEmail">
              <Form.Label className="textFonts">Email address</Form.Label>
              <Form.Control type="email" placeholder="Enter email" />
              <Form.Text className="textFonts">
                We'll never share your email with anyone else.
              </Form.Text>
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicPassword">
              <Form.Label className="textFonts" >Password</Form.Label>
              <Form.Control type="password" placeholder="Password" />
            </Form.Group>
            <Form.Group className="mb-3" controlId="formBasicCheckbox">
              <Form.Check type="checkbox" label="Check me out" />
            </Form.Group>
            <Button variant="primary" type="submit">
              Submit
            </Button>
          </Form>
        </Card.Body>
      </Card>
    </div>
  );
}

export default App;
